‚ñ∂Ô∏è 50 kg to 10 dogs in Donetsk, under Tetiana Shumakova‚Äôs care. She feeds the animals that live near her workplace. They were rescued and raised by the military, and now Tetiana takes care of them;
‚ñ∂Ô∏è 40 kg to 20 cats in Kharkiv, cared for by Olena Artakova. She feeds, treats, and tries to find families for homeless animals.

